    public static void main(String[] args) throws IOException {
        System.setIn(new FileInputStream("src/swacademy/input.txt"));
        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
//        in = new BufferedReader(new StringReader(st));
        StringBuilder sb = new StringBuilder();

        int T = 10;

        for (int tc = 1; tc <= T; tc++) {
            sb.append("#").append(tc).append(" ");
            int test_case = Integer.parseInt(in.readLine());
            int[][] ladder = new int[100][100];
            int[][] checked = new int[100][100];

            for (int i = 0; i < 100; i++) {
                StringTokenizer st = new StringTokenizer(in.readLine());
                for (int j = 0; j < 100; j++) {
                    ladder[i][j] = Integer.parseInt(st.nextToken());
                }
            }

            int r = 0;
            int c = 0;
            int result = 0;
            int min = Integer.MAX_VALUE;
            for (int j = 0; j < 100; j++) {
                System.out.println(j);
                if (ladder[0][j] == 1) {
                    int count = 1;
                    c = j;
                    r = r + 1;
                    if (r == 100) break;
                    checked[r][c] = 1;
                    while (r < 99) {
                        if (c - 1 >= 0 && ladder[r][c - 1] == 1 && checked[r][c - 1] != 1) {
                            c = c - 1;
                            count++;
                            checked[r][c] = 1;
                            while (ladder[r + 1][c] == 0) {
                                c = c - 1;
                                count++;
                                checked[r][c] = 1;
                            }
                        } else if (c + 1 < 100 && ladder[r][c + 1] == 1 && checked[r][c + 1] != 1) {
                            c = c + 1;
                            count++;
                            checked[r][c] = 1;
                            while (ladder[r + 1][c] == 0) {
                                c = c + 1;
                                count++;
                                checked[r][c] = 1;
                            }
                        } else if (r + 1 < 100 && ladder[r + 1][c] == 1) {
                            r = r + 1;
                            count++;
                            checked[r][c] = 1;
                        }
                    }
                    if (min > count) {
                        min = count;
                        result = j;
                    }
                }
            }
            sb.append(min).append("\n");
        }
        System.out.println(sb);
        in.close();
    }
